import React, { useState, useEffect } from 'react';
import { toast } from 'react-toastify';
import api from '../../services/api';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchDashboard();
  }, []);

  const fetchDashboard = async () => {
    try {
      const response = await api.get('/admin/dashboard');
      setStats(response.data);
    } catch (error) {
      console.error('Fetch dashboard error:', error);
      toast.error('„Éá„Éº„Çø„ÅÆÂèñÂæó„Å´Â§±Êïó„Åó„Åæ„Åó„Åü');
    } finally {
      setLoading(false);
    }
  };

  const handleSchedulerAction = async (action) => {
    try {
      const response = await api.post('/admin/system/scheduler', { action });
      toast.success(response.data.message);
      fetchDashboard();
    } catch (error) {
      toast.error(error.response?.data?.message || '„Ç®„É©„Éº„ÅåÁô∫Áîü„Åó„Åæ„Åó„Åü');
    }
  };

  if (loading) {
    return <div className="page-loading">Ë™≠„ÅøËæº„Åø‰∏≠...</div>;
  }

  return (
    <div className="admin-dashboard">
      <div className="page-header">
        <h1>ÁÆ°ÁêÜËÄÖ„ÉÄ„ÉÉ„Ç∑„É•„Éú„Éº„Éâ</h1>
      </div>

      {/* „Çπ„Ç±„Ç∏„É•„Éº„É©„ÉºÁä∂ÊÖã */}
      <section className="scheduler-section">
        <div className="scheduler-card">
          <div className="scheduler-status">
            <span className={`status-indicator ${stats?.scheduler?.isRunning ? 'running' : 'stopped'}`}></span>
            <span className="status-text">
              Ëá™ÂãïÂèñÂºï„Çπ„Ç±„Ç∏„É•„Éº„É©„Éº: {stats?.scheduler?.isRunning ? 'Á®ºÂÉç‰∏≠' : 'ÂÅúÊ≠¢‰∏≠'}
            </span>
          </div>
          <div className="scheduler-actions">
            {stats?.scheduler?.isRunning ? (
              <button className="stop-btn" onClick={() => handleSchedulerAction('stop')}>
                ÂÅúÊ≠¢
              </button>
            ) : (
              <button className="start-btn" onClick={() => handleSchedulerAction('start')}>
                ÈñãÂßã
              </button>
            )}
          </div>
        </div>
      </section>

      {/* Áµ±Ë®à„Ç´„Éº„Éâ */}
      <section className="stats-grid">
        <div className="stat-card">
          <div className="stat-icon">üë•</div>
          <div className="stat-content">
            <span className="stat-value">{stats?.users?.total || 0}</span>
            <span className="stat-label">Á∑è„É¶„Éº„Ç∂„ÉºÊï∞</span>
          </div>
        </div>
        <div className="stat-card">
          <div className="stat-icon">‚úÖ</div>
          <div className="stat-content">
            <span className="stat-value">{stats?.users?.newToday || 0}</span>
            <span className="stat-label">‰ªäÊó•„ÅÆÊñ∞Ë¶èÁôªÈå≤</span>
          </div>
        </div>
        <div className="stat-card">
          <div className="stat-icon">üìà</div>
          <div className="stat-content">
            <span className="stat-value">{stats?.trades?.today?.count || 0}</span>
            <span className="stat-label">‰ªäÊó•„ÅÆÂèñÂºïÊï∞</span>
          </div>
        </div>
        <div className="stat-card warning">
          <div className="stat-icon">‚ö†Ô∏è</div>
          <div className="stat-content">
            <span className="stat-value">{stats?.errors?.byDay?.reduce((a, b) => a + b.count, 0) || 0}</span>
            <span className="stat-label">ÈÄ±Èñì„Ç®„É©„ÉºÊï∞</span>
          </div>
        </div>
      </section>

      {/* „É¶„Éº„Ç∂„ÉºÊ¶ÇË¶Å */}
      <section className="overview-section">
        <h2 className="section-title">„É¶„Éº„Ç∂„ÉºÊ¶ÇË¶Å</h2>
        <div className="overview-grid">
          <div className="overview-card">
            <span className="overview-label">Á∑è„É¶„Éº„Ç∂„Éº</span>
            <span className="overview-value">{stats?.users?.total || 0} ‰∫∫</span>
          </div>
          <div className="overview-card">
            <span className="overview-label">‰ªäÈÄ±„ÅÆÊñ∞Ë¶è</span>
            <span className="overview-value">{stats?.users?.newThisWeek || 0} ‰∫∫</span>
          </div>
        </div>
      </section>

      {/* „Ç∑„Çπ„ÉÜ„É†ÊÉÖÂ†± */}
      <section className="info-section">
        <h2 className="section-title">„Ç∑„Çπ„ÉÜ„É†ÊÉÖÂ†±</h2>
        <div className="info-grid">
          <div className="info-item">
            <span className="info-label">ÂèñÂºï„Çπ„Ç±„Ç∏„É•„Éº„É´</span>
            <span className="info-value">9:00 / 17:00 / 1:00 (JST)</span>
          </div>
          <div className="info-item">
            <span className="info-label">„É¨„Éê„É¨„ÉÉ„Ç∏</span>
            <span className="info-value">1ÂÄçÔºàÂõ∫ÂÆöÔºâ</span>
          </div>
          <div className="info-item">
            <span className="info-label">ÂØæÂøúÈÄöË≤®</span>
            <span className="info-value">BTC, ETH, EOS, XRP</span>
          </div>
